import http from "./httpService";
const endpoint = "teacher";

export const updateTeacherProfile = async ({
  teacherId: teacherId,
  address,
  telNo: tel_no,
  hpNo: hp_no,
  email,
}) =>
  await http.put(`${endpoint}`, { teacherId, address, tel_no, hp_no, email });
